// export default Login
import React from 'react';
import '../Login/Login.css';

const Login = () => {
  return (
    <div className='login-container'>
      <div className='login'>
        <h3 className='textlogin'>Log in to Adhiraj-property</h3>
        <form className='loginform'>
          <div>
            <label style={{ fontSize: '35px', color: 'darkblue' }}>Email:</label>
            <br />
            <input
              type='text'
              style={{ height: '50px', width: '200px' }}
              placeholder='Enter your email'
            />
          </div>
          <div>
            <label style={{ fontSize: '35px', color: 'darkblue' }}>Password:</label>
            <br />
            <input
              type='text'
              style={{ height: '50px', width: '200px' }}
              placeholder='Enter your Password'
            />
          </div>
        </form>
        <br />
        <div className='check'>
          <input type='checkbox' />
          <span style={{ fontSize: '20px', color: 'black' }}>keep me logged in</span>
        </div>
        <button type='button' className='loginbutton'>
          Login
        </button>
      </div>
    </div>
  );
};

export default Login;
